import React, { useState } from 'react';
import './Product.css'
import Sidebar from './Sidebar';
import ProductCard from './ProductCard';
import HeaderImage from './HeaderImage';

const categories = ['All', 'Dog', 'Cat', 'Rabbit', 'Rodents', 'Fish', 'Bird', 'Accessories', 'Pet Food', 'Aquarium'];

function App1() {
  const [selectedCategory, setSelectedCategory] = useState('All'); // State to track selected category

  return (
    <div className="App">
      <HeaderImage />

      <div className="container">
        <Sidebar categories={categories} setSelectedCategory={setSelectedCategory} />

        <div className="product-grid">
          {/* Replace with actual product data */}
          <ProductCard name="Product 1" imageSrc="product1.jpg" price="$20" />
          <ProductCard name="Product 2" imageSrc="product2.jpg" price="$30" />
          <ProductCard name="Product 3" imageSrc="product3.jpg" price="$25" />
          {/* Add more ProductCard components as needed */}
        </div>

        <div className="pagination">
          {/* Pagination or load more button can go here */}
          <p>More items available...</p>
        </div>
      </div>
    </div>
  );
}

export default App1;
